[[module CSS]]
:root {
    --header-title: "GSK项目";
    --header-subtitle: "监视，合作，保护";     
    /* 这里的和上一行只有英文阅读者才能看到 */
    --dark-accent: 0, 11, 23;
    --pale-accent: 243, 186, 0;
    --bright-accent: 243, 186, 0;
    --light-gray-monochrome: 54, 70, 84;
    --dark-gray-monochrome: 26, 26, 51;
    --black-monochrome: 0, 11, 23;
    --medium-accent: 228, 228, 228;
    --tab-border-color: 243, 186, 0;
    --rating-module-button-color: 243, 186, 0;
    --rating-module-button-credit-color: 243, 186, 0;
    --swatch-background: var(--dark-accent);
    --swatch-menutxt-general-color: 243, 186, 0;
    --swatch-menubg-black-color: var(--dark-gray-monochrome);
    --barColour: var(dark-accent);
    /* 主题颜色设置 */
    --header-height-on-desktop: 12.4rem;
    --header-height-on-mobile: 12rem;
    --logo-image: url('https://scpsandboxcn.wikidot.com/local--files/eastcountry-center/site-logo.png');
    --logo-image-size: 200px auto;
    --lgurl: url('https://scpsandboxcn.wikidot.com/local--files/eastcountry-center/site-logo.png');
    --accentColor: 30,181,232;
    --ui-wght: 800;
    --ui-hvr-wght: 500;
    /* 这里是LOGO */
        /* 背景和标题颜色 */
    --background-color: var(--dark-accent);
    /* 主要文本颜色 */
    --swatch-text-light: 228, 228, 228;
    --swatch-text-general: 228, 228, 228;
    /* 主菜单颜色 */
    --swatch-menubg-color: var(--dark-accent);
    /* 二级和三级项目的颜色，如 Blockquote 和 YUI Tabs */
    --swatch-secondary-color: var(--swatch-menubg-dark-color);
    --swatch-tertiary-color: var(--swatch-menubg-medium-dark-color);
    --swatch-alternate-color: var(--swatch-menubg-medium-color);
    --sidebar-links-hover-text-color: var(--dark-accent);
     /* 辅助和第三项的文本颜色，例如侧边栏标题和顶栏菜单文本 */
    --swatch-text-tertiary-color: var(--swatch-menutxt-light-color);
     /* 主要标题颜色 */
    --swatch-topmenu-border-color: 243, 186, 0;
    --swatch-topmenu-bg-color: var(--swatch-menubg-extra-dark-color);
     --rating-module-text-color: 243, 186, 0;
    --rating-module-button-cancel-color: 243, 186, 0;
    ;
     --gradient-header: linear-gradient(to bottom,
            rgb(243, 186, 0) 0%,
            rgb(243, 186, 0) 90%,
            rgb(243, 186, 0) 100%);
     --diagonal-stripes: repeating-linear-gradient(45deg,
            hsla(0, 0%, 100%, 0),
            hsla(0, 0%, 100%, 0) 0.25vh,
            rgba(var(--swatch-menubg-extra-dark-color), 0.1) 0.35vh,
            rgba(var(--swatch-menubg-extra-dark-color), 0.2) 0.5vh);
    /* 侧边栏按钮 */
    --toggle-button-bg: rgb(0, 11, 23);
    --toggle-border-width: 3px;
    --toggle-border-color: rgb(243, 186, 0);
    --toggle-icon-color: rgb(243, 186, 0);
    --toggle-roundness: 0;
}
}
:root:lang(cn) {
    --header-title: "GSK项目";
    --header-subtitle: "监视，合作，保护";
    --logo-image: url('https://scpsandboxcn.wikidot.com/local--files/eastcountry-center/site-logo.png');
     --ui-wght: 800;
    --ui-hvr-wght: 500;
    /* ↑这里是LOGO和标题，防止加载不出，再来一次↑ */
    --body-font: 'Times New Roman', 黑体;
    --header-font: 'Times New Roman', 黑体;
    --title-font: 'Times New Roman', 黑体;
    --mono-font: 'Times New Roman', 黑体;
    --UI-font: 'Times New Roman', '黑体';
        --swatch-text-light: 228, 228, 228;
    --swatch-text-general: 228, 228, 228;
}
    /* 这里是页面标题（中文） */
#extra-div-1 {
    position: absolute;
    z-index: -1;
    top: 0;
    left: 0;
    width: 100%;
    height: var(--header-height-on-desktop);
    pointer-events: none;
    background-image: url('');
    background-repeat: no-repeat;
    background-size: cover;
    background-position: center;
}
    /* 这里是替换banner图片 */
body {
    color: #e4e4e4;
}
blockquote {
    #e4e4e4
}
/* 正文颜色 */
.yui-navset .yui-nav .selected a {
    border-color: #e4e4e4;
    color: rgb(var(--dark-accent)) !important;
}
 .yui-navset .yui-content,
.yui-navset .yui-navset-top .yui-content {
    background: rgb(var(--dark-accent));
    color: #e4e4e4;
}
.yui-navset-bottom .yui-nav li a,
.yui-navset-top .yui-nav li a,
.yui-navset .yui-nav li a {
    background: rgb(var(--dark-gray-monochrome));
    color: #e4e4e4;
}
/* tab栏颜色 */
    a.footnoteref {
        padding: 0.05em;
        color: rgb(var(--swatch-primary));
        -webkit-box-decoration-break: clone;
        box-decoration-break: clone;
        box-shadow: inset 0 0 0 0rem rgba(var(--swatch-primary), 1);
        transition:
            box-shadow 300ms cubic-bezier(0.4, 0.0, 0.2, 1),
            color 300ms cubic-bezier(0.4, 0.0, 0.2, 1),
            padding 300ms cubic-bezier(0.4, 0.0, 0.2, 1),
            margin 300ms cubic-bezier(0.4, 0.0, 0.2, 1);
    }
     a.footnoteref:hover {
        box-shadow: inset 0 -1.25em 0 0 rgba(var(--swatch-primary), 1);
        text-decoration: none;
        color: rgb(var(--black-monochrome))
    }
     .footnotes-footer a[href*="javascript"]::before,
    .bibitems .bibitem::after,
    .footnotes-footer {
        background-color: rgb(var(--black-monochrome));
    }
/* 脚注颜色 */
.post-img {
    display: flex;
    flex-wrap: wrap;
    align-items: flex-start;
    justify-content: center
}
 .column-img .scp-image-block {
    margin: 1rem 0rem;
} 
.mz-img-wrap.img-b3d .scp-image-block .scp-image-caption {
    display: inline-block;
}
 @media (max-width: 767px) {
    .column-img .scp-image-block {
        margin: 1rem -0.25rem 0 0 !important;
    }
}
/* 艺术作品 */

#page-content::after {
    content: "";
    background-image: url("https://scpsandboxcn.wikidot.com/local--files/gsk-gallery/BG.png");
    background-position: center center;
    background-repeat: no-repeat;
    background-size:350px auto;
    opacity: 0.175;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    position: fixed;
    z-index: -1;
}
/* 背景 */

    #header::before {
        background-image: var(--lgurl);
        opacity: 0.6;
        background-size: auto 8rem;
        left: -6rem;
        top: 1.5rem;
    }

    #header h1,
    #header h1 a,
    #header h1 a::before {
        left: 3rem;
        top: -1rem;
        opacity: 1;
    }

    #header h2,
    #header h2 span,
    #header h2 apan::before {
        top: -1rem;
        left: 5.5rem;
       opacity: 1;
    }
    /* 顶部位移 */
[[/module]]
